import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Container, Typography, TextField, Button, Paper, Grid, Box } from '@mui/material';
import needgramLogo from './assets/needgram-logo.png'; // Adjust the path as necessary

const Home = () => {
  const [roomId, setRoomId] = useState('');
  const navigate = useNavigate();

  const joinRoom = () => {
    if (roomId) {
      navigate(`/call/${roomId}`);
    }
  };

  return (
    <Container>
      <Paper elevation={3} style={{ padding: '20px', marginTop: '50px' }}>
        <Grid container spacing={3} alignItems="center">
          <Grid item xs={12} md={6}>
            <Box display="flex" justifyContent="center">
              <img src={needgramLogo} alt="Needgram Logo" style={{ maxWidth: '100%', height: 'auto' }} />
            </Box>
          </Grid>
          <Grid item xs={12} md={6}>
            <Box textAlign="center">
              <Typography variant="h4" gutterBottom>
                Needgram
              </Typography>
              <TextField
                fullWidth
                variant="outlined"
                placeholder="Enter Room ID"
                value={roomId}
                onChange={(e) => setRoomId(e.target.value)}
                style={{ marginBottom: '20px' }}
              />
              <Button variant="contained" color="primary" onClick={joinRoom}>
                Join Room
              </Button>
            </Box>
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
};

export default Home;
